import React, { useState } from 'react';
import styled, { keyframes } from 'styled-components';

// Keyframe animations
const fadeInUp = keyframes`
  from {
    opacity: 0;
    transform: translateY(30px);
  }
  to {
    opacity: 1;
    transform: translateY(0);
  }
`;

const slideInLeft = keyframes`
  from {
    opacity: 0;
    transform: translateX(-50px);
  }
  to {
    opacity: 1;
    transform: translateX(0);
  }
`;

const float = keyframes`
  0%, 100% {
    transform: translateY(0px);
  }
  50% {
    transform: translateY(-10px);
  }
`;

const shimmer = keyframes`
  0% {
    background-position: -200px 0;
  }
  100% {
    background-position: calc(200px + 100%) 0;
  }
`;

// Styled Components
const TeamPageContainer = styled.div`
  min-height: 100vh;
  background: linear-gradient(135deg, #f5f5f5 0%, #e8e8e8 100%);
  position: relative;
  overflow-x: hidden;

  &::before {
    content: '';
    position: absolute;
    top: 0;
    left: 0;
    right: 0;
    bottom: 0;
    background: 
      radial-gradient(circle at 20% 80%, rgba(201, 184, 168, 0.1) 0%, transparent 50%),
      radial-gradient(circle at 80% 20%, rgba(201, 184, 168, 0.1) 0%, transparent 50%);
    pointer-events: none;
    z-index: 0;
  }
`;

const TeamHeader = styled.header`
  text-align: center;
  padding: 120px 20px 80px;
  position: relative;
  z-index: 1;

  &::after {
    content: '';
    position: absolute;
    bottom: 0;
    left: 50%;
    transform: translateX(-50%);
    width: 100px;
    height: 4px;
    background: linear-gradient(90deg, transparent, #c9b8a8, transparent);
    border-radius: 2px;
  }
`;

const MeetOurTeam = styled.h1`
  font-size: clamp(3rem, 8vw, 6rem);
  font-weight: 900;
  margin: 0 0 30px 0;
  line-height: 0.9;
  letter-spacing: -0.02em;
  position: relative;
  display: flex;
  flex-direction: column;
  align-items: center;
  gap: 10px;
`;

const MeetText = styled.span`
  color: #333;
  animation: ${slideInLeft} 1s ease-out;
  position: relative;

  &::after {
    content: '';
    position: absolute;
    bottom: -5px;
    left: 0;
    width: 100%;
    height: 3px;
    background: linear-gradient(90deg, #c9b8a8, transparent);
    transform: scaleX(0);
    transform-origin: left;
    animation: scaleIn 1s ease-out 0.5s forwards;
  }

  @keyframes scaleIn {
    to {
      transform: scaleX(1);
    }
  }
`;

const OurText = styled.span`
  color: #666;
  animation: ${slideInLeft} 1s ease-out 0.2s both;
  font-weight: 700;
`;

const TeamText = styled.span`
  color: #c9b8a8;
  animation: ${slideInLeft} 1s ease-out 0.4s both;
  position: relative;

  &::before {
    content: '';
    position: absolute;
    top: 50%;
    left: -30px;
    transform: translateY(-50%);
    width: 20px;
    height: 2px;
    background: #c9b8a8;
    animation: ${slideInLeft} 1s ease-out 0.6s both;
  }

  &::after {
    content: '';
    position: absolute;
    top: 50%;
    right: -30px;
    transform: translateY(-50%);
    width: 20px;
    height: 2px;
    background: #c9b8a8;
    animation: ${slideInLeft} 1s ease-out 0.6s both;
  }
`;

const TeamDescription = styled.p`
  font-size: 1.2rem;
  color: #666;
  line-height: 1.6;
  max-width: 600px;
  margin: 0 auto;
  animation: ${fadeInUp} 1s ease-out 0.8s both;
  font-weight: 300;
  letter-spacing: 0.5px;
`;

const DepartmentsSection = styled.div`
  display: flex;
  flex-wrap: wrap;
  justify-content: center;
  gap: 15px;
  padding: 0 20px 60px;
  max-width: 1200px;
  margin: 0 auto;
  position: relative;
  z-index: 1;
`;

const DepartmentButton = styled.button`
  background: linear-gradient(135deg, ${props => props.color} 0%, ${props => props.color}dd 100%);
  color: white;
  border: none;
  padding: 12px 24px;
  border-radius: 25px;
  font-size: 0.9rem;
  font-weight: 600;
  cursor: pointer;
  transition: all 0.3s cubic-bezier(0.4, 0, 0.2, 1);
  position: relative;
  overflow: hidden;
  animation: ${fadeInUp} 0.6s ease-out ${props => props.delay}s both;
  box-shadow: 0 4px 15px rgba(0, 0, 0, 0.1);

  &::before {
    content: '';
    position: absolute;
    top: 0;
    left: -100%;
    width: 100%;
    height: 100%;
    background: linear-gradient(90deg, transparent, rgba(255, 255, 255, 0.3), transparent);
    transition: left 0.5s;
  }

  &:hover {
    transform: translateY(-3px) scale(1.05);
    box-shadow: 0 8px 25px rgba(0, 0, 0, 0.2);

    &::before {
      left: 100%;
    }
  }

  &:active {
    transform: translateY(-1px) scale(1.02);
  }
`;

const TeamSections = styled.div`
  max-width: 1400px;
  margin: 0 auto;
  padding: 0 20px 80px;
  position: relative;
  z-index: 1;
`;

const TeamSection = styled.section`
  margin-bottom: 80px;
  animation: ${fadeInUp} 0.8s ease-out;

  &:last-child {
    margin-bottom: 0;
  }
`;

const SectionTitle = styled.h2`
  font-size: 2.5rem;
  font-weight: 800;
  color: #333;
  text-align: center;
  margin-bottom: 50px;
  position: relative;
  letter-spacing: -0.01em;

  &::before {
    content: '';
    position: absolute;
    top: 50%;
    left: 0;
    transform: translateY(-50%);
    width: calc(50% - 100px);
    height: 1px;
    background: linear-gradient(90deg, transparent, #c9b8a8);
  }

  &::after {
    content: '';
    position: absolute;
    top: 50%;
    right: 0;
    transform: translateY(-50%);
    width: calc(50% - 100px);
    height: 1px;
    background: linear-gradient(90deg, #c9b8a8, transparent);
  }
`;

const MembersGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(280px, 1fr));
  gap: 30px;
  justify-items: center;
`;

const MemberCard = styled.div`
  background: white;
  border-radius: 20px;
  padding: 30px;
  text-align: center;
  transition: all 0.4s cubic-bezier(0.4, 0, 0.2, 1);
  position: relative;
  overflow: hidden;
  box-shadow: 0 10px 30px rgba(0, 0, 0, 0.1);
  animation: ${fadeInUp} 0.6s ease-out ${props => props.delay}s both;
  cursor: pointer;

  &::before {
    content: '';
    position: absolute;
    top: 0;
    left: 0;
    right: 0;
    bottom: 0;
    background: linear-gradient(135deg, rgba(201, 184, 168, 0.05) 0%, rgba(201, 184, 168, 0.1) 100%);
    opacity: 0;
    transition: opacity 0.3s ease;
  }

  &:hover {
    transform: translateY(-10px) scale(1.02);
    box-shadow: 0 20px 40px rgba(0, 0, 0, 0.15);

    &::before {
      opacity: 1;
    }
  }

  &:hover img {
    transform: scale(1.1);
  }
`;

const CardOverlay = styled.div`
  position: absolute;
  top: 0;
  left: 0;
  right: 0;
  bottom: 0;
  background: linear-gradient(135deg, rgba(201, 184, 168, 0.9) 0%, rgba(201, 184, 168, 0.7) 100%);
  opacity: 0;
  transition: opacity 0.3s ease;
  display: flex;
  align-items: center;
  justify-content: center;
  border-radius: 20px;

  &::before {
    content: '✨';
    font-size: 3rem;
    animation: ${float} 2s ease-in-out infinite;
  }

  ${MemberCard}:hover & {
    opacity: 1;
  }
`;

const MemberImageStyled = styled.img`
  width: 150px;
  height: 150px;
  border-radius: 50%;
  object-fit: cover;
  margin-bottom: 20px;
  transition: all 0.4s cubic-bezier(0.4, 0, 0.2, 1);
  border: 4px solid transparent;
  background: linear-gradient(white, white) padding-box,
              linear-gradient(135deg, #c9b8a8, #e8ddd4) border-box;
  position: relative;
  z-index: 2;

  &::after {
    content: '';
    position: absolute;
    top: -4px;
    left: -4px;
    right: -4px;
    bottom: -4px;
    border-radius: 50%;
    background: linear-gradient(135deg, #c9b8a8, #e8ddd4);
    z-index: -1;
    opacity: 0;
    transition: opacity 0.3s ease;
  }

  ${MemberCard}:hover & {
    &::after {
      opacity: 1;
    }
  }
`;

const PlaceholderImage = styled.div`
  width: 150px;
  height: 150px;
  background: linear-gradient(135deg, #f0f0f0 0%, #e0e0e0 100%);
  display: flex;
  align-items: center;
  justify-content: center;
  color: #666;
  font-size: 14px;
  text-align: center;
  border-radius: 50%;
  margin-bottom: 20px;
  position: relative;
  overflow: hidden;

  &::before {
    content: '';
    position: absolute;
    top: 0;
    left: -200px;
    width: 200px;
    height: 100%;
    background: linear-gradient(90deg, transparent, rgba(255, 255, 255, 0.4), transparent);
    animation: ${shimmer} 2s infinite;
  }
`;

const PlaceholderText = styled.span`
  position: relative;
  z-index: 1;
  font-weight: 600;
`;

const MemberInfo = styled.div`
  position: relative;
  z-index: 2;
`;

const MemberName = styled.h3`
  font-size: 1.3rem;
  font-weight: 700;
  color: #333;
  margin: 0 0 8px 0;
  letter-spacing: -0.01em;
  transition: color 0.3s ease;

  ${MemberCard}:hover & {
    color: #c9b8a8;
  }
`;

const MemberRole = styled.p`
  font-size: 1rem;
  color: #c9b8a8;
  margin: 0;
  font-weight: 500;
  letter-spacing: 0.5px;
  text-transform: uppercase;
  font-size: 0.9rem;
  transition: all 0.3s ease;

  ${MemberCard}:hover & {
    color: #666;
    transform: translateY(-2px);
  }
`;

// Import profile images directly
// This approach doesn't use dynamic imports which were causing issues
const TeamPage = () => {
  const MemberImage = ({ name, alt }) => {
    const [imageError, setImageError] = useState(false);

    const handleImageError = () => {
      setImageError(true);
    };

    if (imageError) {
      return (
